import React from "react";
import { connect } from "react-redux";
import "./track-info.scss";
import track_thumbnail from "./../../../assets/img/track_thumbnail.png";

const TrackInfo = props => {

    return (
        <div className={"track-info " + "deck-" + props.name}>
            <div className="track-info-thumbnail">
                <img alt="track thumbnails" src=""></img>
            </div>
            <div className="track-info-description">
                <span className="track-info-title">Title from youtube</span>
            </div>
            <div className="track-info-time">
                <span className="time-left">-02:45</span>
                <span className="track-duration">-02:45</span>
            </div>
            <div className="track-bmp">
                <span className="track-bmp-current">117</span>
                <span className="tarck-bmp-pitch">-8%</span>
                <span className="track-bmp-init">128</span>
            </div>
        </div>
    )
}

const mapStateToProps = (state, ownProps) => ({
    track : state.console.deck[ownProps.name].track,
    state : state.console.deck[ownProps.name].state,
})



export default connect(mapStateToProps)(TrackInfo);
